import React from "react";
import { Route } from "react-router-dom";
import MainSection from "./MainPage/MainSection";
import Navigation from "./MainPage/Navigation";

const App = () => {
  return (
    <div>
      <Navigation />
      <MainSection />
      <Route path="/"></Route>
    </div>
  );
};

export default App;
